using Newtonsoft.Json;
using Newtonsoft.Json.Linq;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Text;
using SystemNameCalculator.Utils;

namespace SystemNameCalculator.NameGen
{
    public static class Generator
    {
        public static string GenerateName(ref byte[][] cache0, ref byte[][] cache1)
        {
            byte[][] register = new byte[3][];
            bool alternateCharGetter = false;
            string name = GetCharactersFromAlphaset(ref cache0, ref cache1);
            short add;
            Logging.PrintDebug($"{name} // {Encoding.UTF8.GetBytes(name).Format()}");

            cache0 = cache0.UpdateSeed(); //up to line 129
            if (BitConverter.ToInt16(cache0[0].And(new byte[] { 0x01 }).Zxd(2)) != 0) alternateCharGetter = true;
            cache0 = cache0.UpdateSeed();
            register[0] = cache1[2].Add(new byte[] { 0x01 }).Sub(cache1[1]).Multiply(cache0[0]).Shr(4).Add(cache1[1]).Sub(new byte[] { 0x03 });
            add = BitConverter.ToInt16(register[0].Sxd(2));
            Logging.PrintDebug($"Add: {register[0].Format()} // {(alternateCharGetter ? "alternate" : "default")} getter");

            if (0 < BitConverter.ToInt16(register[0].Sxd(2)))
            {
                float target = 0;
                int index = 0;
                int tries = 8;

                for (int i = 0; i < BitConverter.ToInt16(register[0].Sxd(2)); i++)
                {
                    cache0 = cache0.UpdateSeed();
                    Dictionary<char, double> charWeights = GetStringWeights(name[i..(i + 3)], cache1[0][0]);
                    target = (float)(BitConverter.ToUInt32(cache0[0]) * BitConverter.ToDouble(TinyDouble));

                    if (charWeights.ElementAt(0).Key == '0')
                    {
                        if (add < 3) break;
                        cache1[0] = cache1[0].Add(new byte[] { 0x01 }).And(new byte[] { 0x07, 0x00, 0x00, 0x80 });
                        if (BitConverter.ToInt32(cache1[0].Zxd(4)) < 0) cache1[0]
                                = cache1[0].Sub(new byte[] { 0x01 }).Or(new byte[] { 0xF8, 0xFF, 0xFF, 0xFF }).Add(new byte[] { 0x01 });

                        tries--;
                        i--;

                        if (tries == 0)
                        {
                            string temp = GetCharactersFromAlphaset(ref cache0, ref cache1);

                            if ("aeiou".Contains(name[i + 2]) && "aeiou".Contains(temp[0])) name += '\'';
                            else if (!"aeiou".Contains(temp[0]))
                            {
                                cache0 = cache0.UpdateSeed();
                                name += "aeiou"[cache0[0].Multiply(new byte[] { 0x05 }).Shr(4)[0]];
                            }

                            name += temp;
                            tries = 1;
                            i += 2;
                            add -= 3;
                        }
                    }
                    else
                    {
                        if (alternateCharGetter)
                        {
                            target *= charWeights.Count - 1;
                            index = (int)(BitConverter.ToSingle(BitConverter.GetBytes(target).And(new byte[] { 0x00, 0x00, 0x00, 0x80 }).Or(new byte[] { 0x00, 0x00, 0x00, 0x3F })) + target);
                        }
                        else
                        {
                            float weight = 0;
                            int j;

                            for (j = 0; j < charWeights.Count; j++)
                            {
                                weight += (float)charWeights.ElementAt(j).Value;
                                if (weight >= target) break;
                            }

                            index = j;
                        }

                        name += charWeights.ElementAt(index).Key;
                    }

                    if (name.Length > 63) name = name[..64];

                    Logging.PrintDebug($"{BitConverter.GetBytes(target).Format()} // {index} // {BitConverter.GetBytes(BitConverter.ToUInt32(cache0[0]) * BitConverter.ToDouble(TinyDouble)).Format()}");
                    Logging.PrintDebug($"{name} // {Encoding.UTF8.GetBytes(name).Format()}");
                }
            }

            char first = name[0];
            char second = name[1];

            if (!"aeiou".Contains(first) && !"aeiou".Contains(second))
            {
                if (first != 's' || !"hklmnprtwy".Contains(second))
                {
                    if (second == 'h' && "ctw".Contains(first)) goto finalise;
                    else if (second == 'l' && "bcfgps".Contains(first)) goto finalise;
                    else if (second == 'r' && "bcdfgkpt".Contains(first)) goto finalise;
                    else if (second == 'w' && "dgt".Contains(first)) goto finalise;
                    else if (second == 'y' && "hmr".Contains(first)) goto finalise;

                    InsertVowel(ref name, ref cache0, 1);
                }
            }

        finalise:
            char ult = name[^1];
            char penult = name[^2];

            if (1 < name.Length)
            {
                if (penult != 'g' || "aeio".Contains(ult))
                {
                    if (ult == 'b' && "gn".Contains(penult)) InsertVowel(ref name, ref cache0, name.Length - 1);
                    else if (ult == 'd' && "bdfghkmpst".Contains(penult)) InsertVowel(ref name, ref cache0, name.Length - 1);
                    else if (ult == 'g' && penult == 'l') InsertVowel(ref name, ref cache0, name.Length - 1);
                    else if (ult == 'p' && "bdhkt".Contains(penult)) InsertVowel(ref name, ref cache0, name.Length - 1);
                    else if (ult == 'r' && "bfg".Contains(penult)) InsertVowel(ref name, ref cache0, name.Length - 1);
                    else if (ult == 't' && penult == 'g') InsertVowel(ref name, ref cache0, name.Length - 1);
                    else if (ult == 'w' && !"aeiou".Contains(penult)) InsertVowel(ref name, ref cache0, name.Length - 1);
                }
            }

            int consonanceIndex = GetConsecutiveConsonants(name);
            if (consonanceIndex != -1)
            {
                cache0 = cache0.UpdateSeed();
                consonanceIndex += BitConverter.ToInt32(cache0[0].Multiply(new byte[] { 0x03 }).Shr(4).Add(new byte[] { 0x01 }).Zxd(4));
                InsertVowel(ref name, ref cache0, consonanceIndex);
            }

            return name;
        }

        private static int GetConsecutiveConsonants(string name)
        {
            int consonance = 0;
            for (int i = 0; i < name.Length; i++)
            {
                if (consonance < 3)
                {
                    if (!"aeiou".Contains(name[i])) consonance++;
                    else consonance = 0;
                }
                else
                {
                    if (!"aeiouy".Contains(name[i])) return i - 3;
                    else consonance = 0;
                }
            }

            return -1;
        }

        private static void InsertVowel(ref string name, ref byte[][] seed, int index)
        {
            seed.UpdateSeed();
            name = name.Insert(index, "aeiou"[seed[0].Multiply(new byte[] { 0x05 }).Shr(4)[0]].ToString());
        }

        public static string GetCharactersFromAlphaset(ref byte[][] cache0, ref byte[][] cache1)
        {
            byte[][] register = new byte[2][];

            cache0 = cache0.UpdateSeed();
            register[0] = cache0[0].Multiply(BitConverter.GetBytes(Alphasets[cache1[0][0]].Length / 3)); //seedbotconst
            register[1] = register[0].Shr(4).Multiply(new byte[] { 0x03 }).FormatShort(); //strindex
            return Alphasets[cache1[0][0]][BitConverter.ToInt16(register[1])..BitConverter.ToInt16(register[1].Add(new byte[] { 0x03 }))];
        }

        public static Dictionary<char, double> GetStringWeights(string str, byte alphaset)
        {
            return RecursiveSearch(LetterMap[alphaset][str[0]].ToObject<JArray>(), str);
        }

        private static Dictionary<char, double> RecursiveSearch(JArray arr, string str)
        {
            Dictionary<char, double> result = null;
            int i = 0;
            while (result == null)
            {
                if (i >= arr.Count) return new Dictionary<char, double> { { '0', 0 } };
                else if (arr[i].ToObject<JArray>()[2].ToString() == "ja")
                {
                    if (BitConverter.ToInt32(Encoding.UTF8.GetBytes(str).Zxd(4)) > BitConverter.ToInt32(Encoding.UTF8.GetBytes(arr[i].ToObject<JArray>()[0].ToString()).Zxd(4)))
                    {
                        result = RecursiveSearch(arr[i].ToObject<JArray>()[1].ToObject<JArray>(), str);
                    }
                }
                else if (arr[i].ToObject<JArray>()[2].ToString() == "jz")
                {
                    if (arr[i].ToObject<JArray>()[0].ToString() == str) return arr[i].ToObject<JArray>()[1].ToObject<Dictionary<char, double>>();

                    result = null;
                }

                i++;
            }

            return result;
        }

        public static readonly Dictionary<byte, Dictionary<char, JArray>> LetterMap =
            JsonConvert.DeserializeObject<Dictionary<byte, Dictionary<char, JArray>>>
                (File.ReadAllText(AppDomain.CurrentDomain.BaseDirectory + "letter_map.json"));
        public static readonly byte[] Multiplier = new byte[] { 0x99, 0xF8, 0x76, 0x5A };
        public static readonly byte[] TinyDouble = new byte[] { 0x00, 0x00, 0x10, 0x00, 0x00, 0x00, 0xF0, 0x3D };
        public static readonly string[] Alphasets = new string[] { Alphaset_0, Alphaset_1, Alphaset_2, Alphaset_3, Alphaset_4, Alphaset_5, Alphaset_6, Alphaset_7 };
        public const string Alphaset_0 = "";
        public const string Alphaset_1 = "";
        public const string Alphaset_2 = "";
        public const string Alphaset_3 = "";
        public const string Alphaset_4 = "";
        public const string Alphaset_5 = "";
        public const string Alphaset_6 = "";
        public const string Alphaset_7 = "";
    }
}
